def dig (t, n):
    s = t
    for i in range(1, n + 1):
        p = ma.trunc(2 * s)
        s = 2 * s - p
    return(p)

def TaTau (t, n):
    r = 0
    for k in range(2 * n + 2, 31):
        r = r + dig(t, k) / 2 ** (k - 2 * n)
    return(r)

def g (a, b):
    return((-1) ** a * (a - b) ** 2)
	
def complexExp (a):
    return(ma.cos(a)+complex(0,1)*ma.sin(a))

def Koch (n, t):
    alpha = Pi / 3
    c = 1 / (2 + 2 * ma.cos(alpha))
    r1 = 0
    r1 = 0
    for j in range(1, n + 1):
        r2 = 0
        for k in range(1, j - 1 + 1):
            r2 = r2 + g(dig(t, 2 * k - 1), dig(t, 2 * k))
        r1 = r1 + c ** (j - 1) * (dig(t, 2 * j - 1) * (dig(t, 2 * j - 1) + dig(t, 2 * j)) / 2 + (-1) ** dig(t, 2 * j - 1) * dig(t, 2 * j) * c + complex(0, 1) * dig(t, 2 * j - 1) * (1 - dig(t, 2 * j)) * c * ma.sin(alpha)) * complexExp(alpha * r2)
    r = 0
    for k in range(1, n + 1):
        r = r + g(dig(t, 2 * k - 1), dig(t, 2 * k))
    return(c ** n * TaTau(t, n) * complexExp(alpha * r) + r1)
	
